import os
import sys
import json
import math
import gzip
import base64
import hashlib
import threading
import tempfile
from pathlib import Path
from datetime import datetime
try:
    import customtkinter as ctk
    from tkinter import filedialog, messagebox
except Exception:
    ctk = None
try:
    from Crypto.Cipher import AES
    from Crypto.Protocol.KDF import PBKDF2
    from Crypto.Random import get_random_bytes
except Exception:
    AES = None
TOOL_VERSION = "1.0"
BUFFER_SIZE = 4 * 1024 * 1024
PBKDF2_ROUNDS = 200_000
SALT_BYTES = 16
KEY_LEN = 32
GCM_NONCE_BYTES = 12
ICON_B64 = ""
def is_binary_file(path: Path, sample_bytes: int = 4096) -> bool:
    try:
        with path.open('rb') as f:
            chunk = f.read(sample_bytes)
            return b'\x00' in chunk
    except Exception:
        return False
def derive_key(password: str, salt: bytes) -> bytes:
    return PBKDF2(password, salt, dkLen=KEY_LEN, count=PBKDF2_ROUNDS)
def sha256_of_bytes(data: bytes) -> str:
    h = hashlib.sha256()
    h.update(data)
    return h.hexdigest()
def ensure_customtk():
    if ctk is None:
        try:
            from tkinter import messagebox
            messagebox.showerror('Missing dependency', 'customtkinter is required. Install with: pip install customtkinter')
        except Exception:
            print('customtkinter is required. Install with: pip install customtkinter', file=sys.stderr)
        raise SystemExit
ensure_customtk()
class App(ctk.CTk):
    def __init__(self):
        ensure_customtk()
        super().__init__()
        self.title('Splitter & Joiner')
        self.geometry('980x520')
        ctk.set_appearance_mode('System')
        ctk.set_default_color_theme('dark-blue')
        if ICON_B64:
            try:
                icon_bytes = base64.b64decode(ICON_B64)
                tmp_path = Path(tempfile.gettempdir()) / f"splitter_icon_{os.getpid()}.ico"
                with tmp_path.open('wb') as _f:
                    _f.write(icon_bytes)
                try:
                    self.iconbitmap(str(tmp_path))
                except Exception:
                    try:
                        from tkinter import PhotoImage
                        img = PhotoImage(data=base64.b64encode(icon_bytes).decode('ascii'))
                        self.iconphoto(False, img)
                    except Exception:
                        pass
            except Exception:
                pass
        self.tab_view = ctk.CTkTabview(self, width=860, height=480)
        self.tab_view.pack(padx=10, pady=10, fill='both', expand=True)
        self.tab_view.add('Pack')
        self.tab_view.add('Join')
        self.pack_tab = self.tab_view.tab('Pack')
        self.join_tab = self.tab_view.tab('Join')
        self.init_pack_tab()
        self.init_join_tab()
    def init_pack_tab(self):
        self.src_path = ctk.StringVar()
        self.size_value = ctk.StringVar()
        self.size_unit = ctk.StringVar(value='MB')
        self.encrypt_var = ctk.BooleanVar(value=False)
        self.password = ctk.StringVar()
        self.status = ctk.StringVar()
        ctk.CTkLabel(self.pack_tab, text='Source file:').grid(row=0, column=0, sticky='w', padx=8, pady=6)
        ctk.CTkEntry(self.pack_tab, textvariable=self.src_path, width=620).grid(row=0, column=1, padx=8, pady=6)
        ctk.CTkButton(self.pack_tab, text='...', width=40, command=self.browse_file).grid(row=0, column=2, padx=8, pady=6)
        ctk.CTkLabel(self.pack_tab, text='Chunk size (integer only):').grid(row=1, column=0, sticky='w', padx=8, pady=6)
        ctk.CTkEntry(self.pack_tab, textvariable=self.size_value, width=120).grid(row=1, column=1, sticky='w', padx=(8,0), pady=6)
        unit_cb = ctk.CTkComboBox(self.pack_tab, values=['MB','GB'], variable=self.size_unit, width=80)
        unit_cb.grid(row=1, column=1, sticky='e', padx=(0,120), pady=6)
        ctk.CTkCheckBox(self.pack_tab, text='Encrypt (AES-GCM)', variable=self.encrypt_var, command=self.on_encrypt_toggle).grid(row=2, column=0, columnspan=2, sticky='w', padx=8, pady=6)
        ctk.CTkLabel(self.pack_tab, text='Password (min 8 chars):').grid(row=3, column=0, sticky='w', padx=8, pady=6)
        self.pw_entry = ctk.CTkEntry(self.pack_tab, textvariable=self.password, width=400, show='*', state='disabled')
        self.pw_entry.grid(row=3, column=1, padx=8, pady=6, sticky='w')
        self.show_pw_var = ctk.BooleanVar(value=False)
        ctk.CTkCheckBox(self.pack_tab, text='Show', variable=self.show_pw_var, command=self.toggle_pw_show).grid(row=3, column=2, padx=8, pady=6)
        ctk.CTkButton(self.pack_tab, text='Pack', command=self.on_pack).grid(row=4, column=0, padx=8, pady=12)
        ctk.CTkLabel(self.pack_tab, textvariable=self.status).grid(row=4, column=1, columnspan=2, sticky='w', padx=8, pady=12)
    def init_join_tab(self):
        self.header_path = ctk.StringVar()
        self.join_password = ctk.StringVar()
        self.join_status = ctk.StringVar()
        ctk.CTkLabel(self.join_tab, text='Header file (.json or wrapper):').grid(row=0, column=0, sticky='w', padx=8, pady=6)
        ctk.CTkEntry(self.join_tab, textvariable=self.header_path, width=620).grid(row=0, column=1, padx=8, pady=6)
        ctk.CTkButton(self.join_tab, text='...', width=40, command=self.browse_header).grid(row=0, column=2, padx=8, pady=6)
        ctk.CTkLabel(self.join_tab, text='Password (if encrypted):').grid(row=1, column=0, sticky='w', padx=8, pady=6)
        self.join_pw_entry = ctk.CTkEntry(self.join_tab, textvariable=self.join_password, width=400, show='*')
        self.join_pw_entry.grid(row=1, column=1, padx=8, pady=6, sticky='w')
        self.join_show_pw = ctk.BooleanVar(value=False)
        ctk.CTkCheckBox(self.join_tab, text='Show', variable=self.join_show_pw, command=self.join_toggle_pw).grid(row=1, column=2, padx=8, pady=6)
        ctk.CTkButton(self.join_tab, text='Join', command=self.on_join).grid(row=2, column=0, padx=8, pady=12)
        ctk.CTkLabel(self.join_tab, textvariable=self.join_status).grid(row=2, column=1, columnspan=2, sticky='w', padx=8, pady=12)
    def browse_file(self):
        p = filedialog.askopenfilename()
        if p:
            self.src_path.set(p)
    def browse_header(self):
        p = filedialog.askopenfilename(filetypes=[('JSON','*.json'),('All files','*.*')])
        if p:
            self.header_path.set(p)
    def toggle_pw_show(self):
        if self.show_pw_var.get():
            self.pw_entry.configure(show='')
        else:
            self.pw_entry.configure(show='*')
    def join_toggle_pw(self):
        if self.join_show_pw.get():
            self.join_pw_entry.configure(show='')
        else:
            self.join_pw_entry.configure(show='*')
    def on_encrypt_toggle(self):
        if self.encrypt_var.get():
            self.pw_entry.configure(state='normal')
        else:
            self.pw_entry.configure(state='disabled')
            self.password.set('')
    def validate_pack_inputs(self):
        p = self.src_path.get().strip()
        if not p or not os.path.isfile(p):
            messagebox.showerror('Error','Please select a valid source file.')
            return False
        s = self.size_value.get().strip()
        if not s.isdigit():
            messagebox.showerror('Error','Chunk size must be an integer (no letters, no commas).')
            return False
        v = int(s)
        if v <= 0:
            messagebox.showerror('Error','Chunk size must be greater than 0.')
            return False
        if self.size_unit.get() not in ('MB','GB'):
            messagebox.showerror('Error','Unit must be MB or GB.')
            return False
        if self.encrypt_var.get():
            pw = self.password.get()
            if not pw or len(pw) < 8:
                messagebox.showerror('Error','Password must be at least 8 characters.')
                return False
        return True
    def on_pack(self):
        if not self.validate_pack_inputs():
            return
        t = threading.Thread(target=self.pack_worker, daemon=True)
        t.start()
    def pack_worker(self):
        try:
            src = Path(self.src_path.get())
            s_val = int(self.size_value.get())
            unit = self.size_unit.get()
            chunk_limit = s_val * (1024 ** 2 if unit == 'MB' else 1024 ** 3)
            is_binary = is_binary_file(src)
            use_base64 = is_binary
            if use_base64:
                raw_chunk_max = math.floor(chunk_limit * 3 / 4)
                if raw_chunk_max <= 0:
                    messagebox.showerror('Error','Chunk limit too small for base64 encoded chunks.')
                    return
            else:
                raw_chunk_max = chunk_limit
            encrypt = self.encrypt_var.get()
            password = self.password.get() if encrypt else None
            outdir = filedialog.askdirectory(title='Choose destination folder (a subfolder will be created)')
            if not outdir:
                return
            timestamp = datetime.utcnow().strftime('%Y%m%dT%H%M%SZ')
            folder_name = f"pack_{src.stem}_{timestamp}"
            out_folder = Path(outdir) / folder_name
            out_folder.mkdir(parents=True, exist_ok=False)
            manifest = {
                'tool_version': TOOL_VERSION,
                'timestamp': timestamp,
                'original_filename': src.name,
                'original_size': src.stat().st_size,
                'is_binary': bool(is_binary),
                'encoding': 'base64' if use_base64 else 'none',
                'encrypted': bool(encrypt),
                'pbkdf2_rounds': PBKDF2_ROUNDS,
                'chunks': []
            }
            salt = None
            verifier_salt = None
            if encrypt:
                if AES is None:
                    messagebox.showerror('Error','PyCryptodome required. Install with: pip install pycryptodome')
                    return
                salt = get_random_bytes(SALT_BYTES)
                manifest['salt_b64'] = base64.b64encode(salt).decode('ascii')
                verifier_salt = get_random_bytes(SALT_BYTES)
                manifest['verifier_salt_b64'] = base64.b64encode(verifier_salt).decode('ascii')
                verifier = PBKDF2(password, verifier_salt, dkLen=KEY_LEN, count=PBKDF2_ROUNDS)
                manifest['password_verifier_hex'] = verifier.hex()
            idx = 0
            read_total = 0
            with src.open('rb') as f:
                while True:
                    chunk = f.read(raw_chunk_max)
                    if not chunk:
                        break
                    idx += 1
                    read_total += len(chunk)
                    out_bytes = chunk
                    enc_label = 'none'
                    if use_base64:
                        out_bytes = base64.b64encode(chunk)
                        enc_label = 'base64'
                    chunk_encrypted = False
                    nonce_b64 = None
                    tag_b64 = None
                    if encrypt:
                        key = derive_key(password, salt)
                        nonce = get_random_bytes(GCM_NONCE_BYTES)
                        cipher = AES.new(key, AES.MODE_GCM, nonce=nonce)
                        ciphertext, tag = cipher.encrypt_and_digest(out_bytes)
                        out_bytes = ciphertext
                        chunk_encrypted = True
                        nonce_b64 = base64.b64encode(nonce).decode('ascii')
                        tag_b64 = base64.b64encode(tag).decode('ascii')
                    chunk_name = f"{src.name}.part{idx:04d}"
                    chunk_path = out_folder / chunk_name
                    with chunk_path.open('wb') as wf:
                        wf.write(out_bytes)
                    sha = sha256_of_bytes(out_bytes)
                    entry = {
                        'index': idx,
                        'filename': chunk_name,
                        'size': chunk_path.stat().st_size,
                        'sha256': sha,
                        'encoding': enc_label,
                        'encrypted': chunk_encrypted
                    }
                    if chunk_encrypted:
                        entry['nonce_b64'] = nonce_b64
                        entry['tag_b64'] = tag_b64
                    manifest['chunks'].append(entry)
                    self.status.set(f'Written: {idx} chunks, {read_total} bytes read')
            manifest_bytes = json.dumps(manifest, ensure_ascii=False).encode('utf-8')
            wrapper_index = 0
            current_filename = f"{src.name}.header.json"
            current_bytes = manifest_bytes
            while len(current_bytes) > chunk_limit:
                wrapper_index += 1
                inner_name = f"{src.name}.header.inner{wrapper_index}"
                inner_path = out_folder / inner_name
                compressed = gzip.compress(current_bytes)
                with inner_path.open('wb') as ih:
                    ih.write(compressed)
                inner_sha = sha256_of_bytes(compressed)
                wrapper = {
                    'tool_version': TOOL_VERSION,
                    'timestamp': datetime.utcnow().strftime('%Y%m%dT%H%M%SZ'),
                    'wrapped': True,
                    'wrapped_filename': inner_name,
                    'wrapped_size': len(compressed),
                    'wrapped_sha256': inner_sha,
                    'encoding': 'gzip',
                    'encrypted': manifest.get('encrypted', False)
                }
                if manifest.get('encrypted'):
                    wrapper['password_verifier_hex'] = manifest.get('password_verifier_hex')
                    wrapper['verifier_salt_b64'] = manifest.get('verifier_salt_b64')
                current_bytes = json.dumps(wrapper, ensure_ascii=False).encode('utf-8')
                current_filename = f"{src.name}.header.json"
            final_path = out_folder / current_filename
            with final_path.open('wb') as fh:
                fh.write(current_bytes)
            self.status.set(f'Packing complete. Chunks: {len(manifest["chunks"])}')
            messagebox.showinfo('Done', f'Packing complete. Folder: {out_folder}\nHeader: {final_path}')
        except FileExistsError:
            messagebox.showerror('Error','Destination folder already exists. Choose another folder.')
        except Exception as e:
            messagebox.showerror('Error',f'Packing failed: {e}')
    def on_join(self):
        t = threading.Thread(target=self.join_worker, daemon=True)
        t.start()
    def join_worker(self):
        try:
            header_p = Path(self.header_path.get())
            if not header_p.exists():
                messagebox.showerror('Error','Header file not found.')
                return
            folder = header_p.parent
            manifest, header_bytes = self.load_manifest_recursive(header_p)
            if manifest is None:
                return
            encrypted = manifest.get('encrypted', False)
            if encrypted:
                verifier_hex = manifest.get('password_verifier_hex')
                verifier_salt_b64 = manifest.get('verifier_salt_b64')
                if not verifier_hex or not verifier_salt_b64:
                    messagebox.showerror('Error','Missing password verifier in header.')
                    return
                if not self.join_password.get() or len(self.join_password.get()) < 8:
                    messagebox.showerror('Error','Please enter the correct password (min 8 chars)')
                    return
                verifier_salt = base64.b64decode(verifier_salt_b64)
                candidate = PBKDF2(self.join_password.get(), verifier_salt, dkLen=KEY_LEN, count=PBKDF2_ROUNDS).hex()
                if candidate != verifier_hex:
                    messagebox.showerror('Error','Password verifier mismatch. Wrong password.')
                    return
            chunks = manifest.get('chunks', [])
            if not chunks:
                messagebox.showerror('Error','No chunks found in manifest.')
                return
            outfile = filedialog.asksaveasfilename(title='Choose output filename', initialfile=manifest.get('original_filename','output.bin'))
            if not outfile:
                return
            outpath = Path(outfile)
            chunks_sorted = sorted(chunks, key=lambda c: c['index'])
            salt = base64.b64decode(manifest.get('salt_b64')) if manifest.get('salt_b64') else None
            key = derive_key(self.join_password.get(), salt) if encrypted else None
            with outpath.open('wb') as of:
                for idx, cinfo in enumerate(chunks_sorted, start=1):
                    fname = cinfo['filename']
                    chunk_path = folder / fname
                    if not chunk_path.exists():
                        messagebox.showerror('Error',f'Chunk missing: {fname}')
                        return
                    data = chunk_path.read_bytes()
                    sha_actual = sha256_of_bytes(data)
                    if sha_actual != cinfo['sha256']:
                        messagebox.showerror('Error',f'Hash mismatch for {fname}: expected {cinfo["sha256"]} != {sha_actual}')
                        return
                    if cinfo.get('encrypted'):
                        nonce = base64.b64decode(cinfo['nonce_b64'])
                        tag = base64.b64decode(cinfo['tag_b64'])
                        cipher = AES.new(key, AES.MODE_GCM, nonce=nonce)
                        try:
                            data = cipher.decrypt_and_verify(data, tag)
                        except Exception as e:
                            messagebox.showerror('Error',f'Decryption failed for {fname}: {e}')
                            return
                    if cinfo.get('encoding') == 'base64':
                        data = base64.b64decode(data)
                    of.write(data)
                    self.join_status.set(f'Assembled: {idx}/{len(chunks_sorted)}')
            messagebox.showinfo('Done', f'Join complete: {outpath}')
            self.join_status.set('Done')
        except Exception as e:
            messagebox.showerror('Error',f'Join failed: {e}')
    def load_manifest_recursive(self, header_path: Path):
        try:
            cur_path = header_path
            max_layers = 20
            for _ in range(max_layers):
                raw = cur_path.read_bytes()
                try:
                    manifest = json.loads(raw.decode('utf-8'))
                except Exception:
                    try:
                        decompressed = gzip.decompress(raw)
                        manifest = json.loads(decompressed.decode('utf-8'))
                    except Exception:
                        messagebox.showerror('Error','Unable to parse header or wrapped file.')
                        return None, None
                if manifest.get('wrapped'):
                    wrapped_name = manifest.get('wrapped_filename')
                    if not wrapped_name:
                        messagebox.showerror('Error','Wrapped header missing filename.')
                        return None, None
                    wrapped_path = cur_path.parent / wrapped_name
                    if not wrapped_path.exists():
                        messagebox.showerror('Error',f'Wrapped file missing: {wrapped_name}')
                        return None, None
                    cur_path = wrapped_path
                    continue
                return manifest, raw
            messagebox.showerror('Error','Too many wrapper layers or recursive loop.')
            return None, None
        except Exception as e:
            messagebox.showerror('Error',f'Error reading header: {e}')
            return None, None
if __name__ == '__main__':
    app = App()
    app.mainloop()
